import BasicLayout from "../../layouts/BasicLayout";


function LoginPage(props) {
    return (
        <div className="fixed top-0 left-0 z-[1055] flex flex-col h-full w-full">

            <BasicLayout>

                    <LoginComponent/>

            </BasicLayout>


        </div>
    );
}

export default LoginPage;
